	def find132pattern(self, nums):
		stack = []
		for i in range(len(nums)):
			pair = nums[i]
			while stack and nums[i] >= stack[-1][0]:
				pair = min(pair, stack.pop()[1])
			if stack and nums[i] > stack[-1][1]:
				return True
			stack.append([nums[i], pair])
		return False
